let currentAlarms = msg.payload;
let lastAlarms = flow.get("lastAlarms") || {};
let messages = [];

for (let key in currentAlarms) {
    let newMsg = {};
    // Rising edge: false → true
    if (currentAlarms[key] === true && lastAlarms[key] !== true) {
       // let newMsg = {};
        newMsg.payloadd= "SP_Alarm_Insert_ML10",
            newMsg.queryParams= [
                { name: "AlarmCode", value: key.toString() }
            ]

        messages.push(newMsg);
    }

    // Falling edge: true → false
    if (currentAlarms[key] === false && lastAlarms[key] === true) {
       // let newMsg = {};
        newMsg.payloadd = "SP_Alarm_Update_ML10",
            newMsg.queryParams = [
                { name: "AlarmCode", value: key.toString() }
            ]

        messages.push(newMsg);
    }
}



